import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './amenitiesTable.css';

const AmenitiesTable = () => {
    const [amenities, setAmenities] = useState([]);
    const [error, setError] = useState(null);

    useEffect(() => {
        // Fetch amenities data when the component mounts
        fetchAmenities();
    }, []);

    const fetchAmenities = async () => {
        try {
            const response = await axios.get('http://localhost:9898/amenities'); // Adjust the URL accordingly
            setAmenities(response.data.data);
        } catch (error) {
            setError(error);
        }
    };

    return (
        <div className="card1amenities">
            <h2 className="card-titleamenities">Amenities Table</h2>
            <div className="table-containeramenities">
                <table className="society-tableamenities">
                    <thead>
                        <tr>
                            <th>Amenity ID</th>
                            <th>Amenity Name</th>
                        </tr>
                    </thead>
                    <tbody>
                        {error && <tr><td colSpan="2">Error: {error.message}</td></tr>}
                        {amenities.map(amenity => (
                            <tr key={amenity.id}>
                                <td>{amenity.id}</td>
                                <td>{amenity.name}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
};

export default AmenitiesTable;
